import React from 'react';

const Header = () => {
  return (
    <>
      <header>
        <h1>Book Finder</h1>
        <button type="button">로그인</button>
      </header>
      <nav>
        <ul>
          <li>베스트셀러</li>
          <li>추천도서</li>
          <li>신간도서</li>
        </ul>
        <input type="text" />
        <i className="fas fa-search"></i>
      </nav>
    </>
  );
};

export default Header;
